import { Text,TextInput, Button, Group, Box, Card,Grid, Chip, Badge, Center,PasswordInput, JsonInput} from '@mantine/core';
import axios from 'axios';
import { notifications } from '@mantine/notifications';
import { IconCheck,IconAlertCircle, IconFaceIdError, IconEarOff, IconFaceId,IconLock, IconUserCircle, IconAt } from '@tabler/icons-react';
import { useForm } from '@mantine/form';
import { useDisclosure } from '@mantine/hooks';

function PasswordAuth(){
    let userName = '';
    let Password = '';
    const form = useForm({
        initialValues: { userName: '', password: ''},
    
        // functions will be used to validate values at corresponding key
        validate: {
          userName: (value) => (value.length < 2 ? 'Name must have at least 2 letters' : null),
          password: (value) => (value.length < 4 ? 'Password length must be at least 4 characters.' : null),
        },
      });

      return(
            <Center>
                <Box maw={620} mx="auto">
                <form>
                    <TextInput label="Username" placeholder='Please enter your username' {...form.getInputProps('userName')} />
                    <PasswordInput label="Password" placeholder='' {...form.getInputProps('password')} />
                    <Button>
                        Login
                    </Button>
                    <JsonInput
                    label="Response Body"
                    placeholder="JSON Response Body"
                    validationError="Invalid JSON"
                    formatOnBlur
                    autosize
                    minRows={4}
                    id="resBody">

                    </JsonInput>
                </form>
                </Box>
            </Center>
      );

}

export default PasswordAuth;
